import React from 'react';

const Header: React.FC = () => {
  return (
    <header className="fixed top-0 left-0 right-0 z-50 p-4">
      <nav className="max-w-7xl mx-auto flex justify-between items-center">
        <div className="flex space-x-8">
          <a href="#about" className="text-black hover:text-gray-600">ABOUT</a>
          <a href="#project" className="text-black hover:text-gray-600">PROJECT</a>
          <a href="#profile" className="text-black hover:text-gray-600">PROFILE</a>
        </div>
        <button className="bg-[#00FF94] text-black px-6 py-2 rounded-full hover:bg-[#00CC75] transition-colors">
          CONTACT US
        </button>
      </nav>
    </header>
  );
};

export default Header;
